import React from "react";
import { useEffect } from 'react';
import "./styles.css";
import Button from "@mui/material/Button";
import { useNavigate } from "react-router-dom";
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { GoogleLogin } from 'react-google-login';
import { gapi } from 'gapi-script';

const theme = createTheme({
    status: {
        danger: '#e53e3e',
    },
    palette: {
        primary: {
            main: '#ff8a00',
        },
        neutral: {
            main: '#ffffff',
            contrastText: '#ff8a00',
        },
    },
});

const clientID = "1090577027379-t1c9h7v7onccmjpv1j4fr0jsa06dle8i.apps.googleusercontent.com";

const LoginButton = () => {
    return (
        <div id="loginButton">
            <GoogleLogin
                clientId={clientID}
                buttonText='Login'
                onSuccess={onSuccess}
                onFailure={onFailure}
                cookiePolicy={'single_host_origin'}
                isSignedIn={true}
            />
        </div>
    )
};

const onSuccess = (result) => {
    console.log("LOGIN SUCCESS; Current User: " + result.profileObj);
}

const onFailure = (result) => {
    console.log("LOGIN FAILED; Result: " + result);
}


function LoginPage() {
    const navigate = useNavigate();
    useEffect(() => {
        const start = () => {
            gapi.client.init({
                clientId: clientID,
                scope: "",
            })
        };

        gapi.load('client:auth2', start);
    });

    return (
        <>
            <ThemeProvider theme={theme}>
                <div>
                    <h2>This is a member-only page.</h2>
                    <h4>Please log-in first to continue.</h4>
                </div>
                <LoginButton />
                <Button style={{ "display": "flex" }}
                    variant="contained"
                    color="neutral"
                    onClick={() => { navigate('/') }}
                    className="navHome">Return Home</Button>
            </ThemeProvider>
        </>
    )
}

export default LoginPage;
